void visit(ImageElement element, String value) throws IOException {
  if(inInode) {
    switch(element) {
    case INODE_PATH:
      if(value.equals("")) path = "/";
      else path = value;
      break;
    case PERMISSION_STRING:
      perms = value;
      break;
    case REPLICATION:
      replication = Integer.valueOf(value);
      break;
    case USER_NAME:
      username = value;
      break;
    case GROUP_NAME:
      group = value;
      break;
    case NUM_BYTES:
      filesize += Long.valueOf(value);
      break;
    case MODIFICATION_TIME:
      modTime = value;
      break;
    case SYMLINK:
      linkTarget = value;
      break;
    default:
      // This is OK.  We're not looking for all the values.
      break;
    }
  }
}
